import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#ffa500',
      alignItems: 'center',
      justifyContent: 'center',
    },
    viewTitulo: {
      height:'10%',
      width:'100%',
      alignItems:'center',
      justifyContent:'center',
      backgroundColor:'blue'
    },
    textTitle: {
      fontSize:23,
    },
    viewInputsGeral:{
      height:'80%',
      width:'100%',
      alignItems: 'start',
      justifyContent: 'flex-start',
    },
    linha:{
      flexDirection:'row',
      height: '20%',
      width: '100%',
    },
    titulosInput:{
      height:'100%',
      width:'50%',
    },
    textInput:{
      fontSize:19,
  
    },
    viewInput:{
      height:'100%',
      width:'50%',
      alignItems: 'center',
      justifyContent: 'center',
      
    },
    input:{
      borderWidth:1,
      borderColor:'#b87e14',
      height:'50%',
      width:'55%',
      borderRadius:10,
    },
    viewBot:{
      height:'10%',
      width:'100%',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
